import styled from "styled-components";

import React from "react"

export default function About(){
    const Styleh2=styled.div`
    color:;`
    return(
        <section className="row mt-5">
            <Styleh2><h4 className="text-center">ABOUT THE AMIGO</h4></Styleh2>
            <Styleh2><p className="para col-12 col-md-10 col-lg-7 text-center mx-auto">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since. Lorem Ipsum has been the industry</p></Styleh2>

            <div className="col-md-6 col-lg ms-3 mt-5">
                <img src="../images/illustration/light-bulb.png" alt="" />
                <h6>CREATIVITY</h6>
                <p className="para ">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
            </div>
            <div className="col-md-6 col-lg mt-5">
                <img src="../images/illustration/globe.png" alt="" />
                <h6>STRATEGY</h6>
                <p className="para">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
            </div>
            <div className="col-md-6 col-lg mt-5">
                <img src="../images/illustration/attach.png" alt="" />
                <h6>DESIGN</h6>
                <p className="para">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
            </div>
            <div className="col-md-6 col-lg-3 mt-5">
                <img src="../images/illustration/customer-support.png" alt="" />
                <h6>DEVELOPMENT</h6>
                <p className="para">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
            </div>

    
        <div className="s2 row bg-dark text-light align-items-center">
            <div className="col-12 col-md-6 col-lg-3">
            <div className="d-flex gap-3 gap-md-0 p-3">
                    <img src="../images/illustration/man.png" alt="" />
                <div>
                    <h1>60</h1>
                    <p>EMPLOYEES</p>
                </div>
                </div>
            </div>

            <div className="col-12 col-md-6 col-lg-3">
                <div className="d-flex gap-3 gap-md-0 p-3">
                    <img src="../images/illustration/smile.png" alt="" />
                <div>
                    <h1>980</h1>
                    <p>SATISFIED CLIENTS</p>
                </div>
                </div>
            </div>

            <div className="col-12 col-md-6 col-lg-3">
            <div className="d-flex gap-3 gap-md-0 p-3">
                <img src="../images/illustration/time.png" alt="" />
                <div>
                    <h1>15</h1>
                    <p>EXPERIENCE</p>
                </div>
            </div>
            </div>

            <div className="col-12 col-md-6 col-lg-3 ">
                <div className="d-flex gap-3 gap-md-0 p-3">
                    <img src="../images/illustration/tyre.png" alt="" />
                    <div>
                        <h1>400</h1>
                        <p>CUPS OF COFFEE</p>
                    </div>
                </div>
            </div>
        </div>

        </section>

    )
}
